import React from "react";
import ReatDOM from "react-dom";

export default function getZip(zip){
     
    zip = 10305;
    let zipcode =  fetch(`http://ctp-zip-api.herokuapp.com/zip/${zip}`);
    console.log(zipcode);
    let data = zipcode.json;
    return(data)
}
